INSERT INTO `noticias` VALUES (1,'LAS UGEL ELABORARÁN MAPA DE PROCESOS Y MANUAL DE OPERACIONES','est faasads','<p><span style=\"color: rgb(68, 68, 68); font-family: Roboto, sans-serif; font-size: 15px;\">El equipo técnico de la Dirección Regional de Educación conjuntamente con los representantes del área de administración de las 11 UGEL de la región Huánuco, sostuvieron una reunión de trabajo para la elaboración del Mapa de Procesos (MAPRO) y el Manual de Operaciones (MOP), herramientas indispensables para la gestión pública.</span><br></p><div class=\"l7ghb35v kjdc1dyq kmwttqpk gh25dzvf jikcssrz n3t5jt4f\" style=\"box-sizing: inherit; color: rgb(68, 68, 68); font-family: Roboto, sans-serif; font-size: 15px;\"><div dir=\"auto\" style=\"box-sizing: inherit;\">El director Regional de Educación Mg. Nolberto Crespo Céspedes inauguró la reunión, además estuvo acompañado de sus funcionarios.</div><div dir=\"auto\" style=\"box-sizing: inherit;\">“Es muy satisfactorio tenerlos reunidos para trabajar conjuntamente en la elaboración de estos instrumentos de gestión, para que se descentralice en las 11 UGEL de la región Huánuco, y esté más cerca a la población”, manifestó el titular de la DRE Huánuco Mg. Noberto Crespo Céspedes</div><div dir=\"auto\" style=\"box-sizing: inherit;\">La asistencia técnica estuvo a cargo del Especialista Ing. Abner Valverde que pertenece al equipo técnico de la Sub Gerencia de Modernización y Transformación Digital, quien explicó los pasos a seguir para la elaboración de los instrumentos de gestión del MAPRO Y MOP.</div></div>','noticia1..png','public/notas-prensa/1-2-20220913-100045.jpg','s',1,'2022-09-13 10:00:46',1,NULL,'2023-01-17 04:09:10'),(2,'EN CONFERENCIA MAGISTRAL RINDEN HOMENAJE AL XCII ANIVERSARIO DE NACIMIENTO DEL LINGÜÍSTICA ALFREDO TORERO FERNÁNDEZ DE CÓRDOVA','','<p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 20px; margin-left: 0px; color: rgb(68, 68, 68); font-family: Roboto, sans-serif; font-size: 15px;\">Con la finalidad de reconocer y valorar su investigación científica, fundador de la “Lingüística Andina” del Perú”, la Dirección Regional de Educación Huánuco, Asociación Nacional de Traductores e Intérpretes de la región Huánuco y la Dirección Desconcentrada de Cultura Huánuco, rindieron homenaje al XCII aniversario de nacimiento del lingüística Alfredo Torero Fernández de Córdova a través de las conferencias magistrales desarrollado este último fin de semana.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 20px; margin-left: 0px; color: rgb(68, 68, 68); font-family: Roboto, sans-serif; font-size: 15px;\">La conferencia magistral lo realizó Gustavo Solís Fonseca Dr. En Lenguas Amerindias Lingüista y profesor principal de la Universidad Nacional Mayor de San Marcos, tema: “La ilustre trayectoria de Alfredo Torero Fernández”; asimismo, participó el señor Oscar Chávez Gonzáles, Coordinador de lenguas originarias y Especialista EIB del Ministerio de Educación. Por la región Huánuco, participó el Dr. Víctor Domínguez Condezo escritor, poeta e investigador en las áreas de etnolingüística y cultura andina exponiendo el tema: “Algunas consideraciones sobre el quechua Yaru – Huánuco”.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 20px; margin-left: 0px; color: rgb(68, 68, 68); font-family: Roboto, sans-serif; font-size: 15px;\">Alfredo Torero Fernández de Córdova antropólogo y lingüista, aportó mucho en nuestro país pluricultural y multilingüe y sus trabajos, vienen siendo aportados en la lucha de las comunidades indígenas amazónicas en defensa de su patrimonio histórico cultural.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 20px; margin-left: 0px; color: rgb(68, 68, 68); font-family: Roboto, sans-serif; font-size: 15px;\">La Dirección Regional de Educación de Huánuco, brinda a través de estas actividades la difusión, preservación y conservación de la identidad cultural reafirmando el compromiso de la implementación de una educación intercultural bilingüe, como una forma de implementar las políticas de educación intercultural, hacia el logro de una educación pertinente y de calidad.</p>','noticia2.png','.png','s',1,'2022-09-13 12:26:21',1,NULL,'2023-01-17 03:46:10'),(3,'DRE HUÁNUCO A TRAVÉS DE MESA DE DIÁLOGO GARANTIZÓ LA EJECUCIÓN DEL PROYECTO PARA DOTAR INTERNET A LA COMUNIDAD EDUCATIVA DE HUANZAPAMPA','','<p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 20px; margin-left: 0px; color: rgb(68, 68, 68); font-family: Roboto, sans-serif; font-size: 15px;\">En una mesa de dialogo presidido por el director regional de educación Huánuco, Nolberto Crespo Céspedes con los dirigentes comunales del centro poblado de Huanzapampa, jurisdicción que pertenece al distrito de Yanas, provincia de Dos de Mayo, y representantes del Programa Nacional de Telecomunicaciones (PRONATEL), llegaron a un acuerdo para continuar con la ejecución del Proyecto “Creación de Banda Ancha para la conectividad integral y desarrollo social en la regiónHuánuco”.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 20px; margin-left: 0px; color: rgb(68, 68, 68); font-family: Roboto, sans-serif; font-size: 15px;\">A pesar de haberse realizado trabajos de sensibilización algunos lugareños tenían desconocimiento del proyecto, motivo por el cual PRONATEL, solicitó la intervención de las autoridades del sector educación, llegando a buenos acuerdos para que se culmine el proyecto que presenta un avance de 60%.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 20px; margin-left: 0px; color: rgb(68, 68, 68); font-family: Roboto, sans-serif; font-size: 15px;\">La ejecución del proyecto es financiado mediante PRONATEL a través del Ministerio de Transporte y Comunicaciones (MTC), que tiene por objetivo brindar servicios de internet e intranet a 348 localidades, 341 instituciones educativas, 161 establecimientos de salud y 14 dependencias policiales en la región de Huánuco, permitiendo el desarrollo social y el cierre de la brecha digital a favor de las localidades rurales más alejadas de la región.</p><p style=\"box-sizing: inherit; margin-right: 0px; margin-bottom: 20px; margin-left: 0px; color: rgb(68, 68, 68); font-family: Roboto, sans-serif; font-size: 15px;\">En la jornada de trabajo que se desarrolló hoy por la mañana en los ambientes de la IIEE N° 32351, participaron la directora de gestión institucional de la DRE, Econ. Sonia Albornoz Soto, el director de la UGEL Dos de Mayo, Roberto Villareal Domínguez, entre otras autoridades.</p>','noticia3.jpg','s','s',1,'2022-09-13 12:30:00',1,NULL,'2023-01-16 07:08:14'),(9,'sdfsfsdfs','esto es una prueba de descripcion corta','<p>sdfsdfsdf</p>','16739069821.jpg',NULL,NULL,1,'2023-01-16 22:09:42',1,'2023-01-17 03:09:42','2023-01-17 04:20:27'),(10,'jhvhv','hgvhgc','<p>hgfhgfhgchgv</p>','16739183361.png',NULL,NULL,1,'2023-01-17 00:00:00',1,'2023-01-17 06:18:56','2023-01-17 06:18:56');
