png;base64,\" style=\"width: 409px;\" data-filename=\"Imagen3.png\"><span style=\"font-family: Arial;\"><br></span></div><div style=\"color: rgb(33, 37, 41); font-family: Oswald, sans-serif; text-align: justify;\"><span style=\"font-family: Arial;\">Asimismo, cumpliendo con los protocolos establecidos por la normativa del estado de emergencia debido a la pandemia mundial, originado por el COVID-19; convirtiéndose en esta parte de la Región Huánuco como una de las UGEL que innovo en las plataformas virtuales para la continuación de los aprendizajes con nuestros directores, docentes, niños, niñas, adolescentes y toda la comunidad educativa de nuestra jurisdicción.</span></div><div style=\"color: rgb(33, 37, 41); font-family: Oswald, sans-serif; text-align: justify;\"><span style=\"font-family: Arial;\">Iniciando una nueva etapa de gestión a cargo del Mg. Hugo Eduardo Palomino Esteban , actual director de la UGEL Huacaybamba, asumiendo los compromisos para la ejecución al 100% del presupuesto y cumplimiento de metas para el presente año, asimismo para la construcción del Proyecto Educativo Local (PEL), generar las condiciones para el Buen Inicio del Año Escolar 2021, con monitoreo y talleres de fortalecimiento de capacidades.</span></div>',1,'2023-01-19 10:01:40','2023-01-19 10:05:22'),(15,'MISION Y VISION','<div class=\"row\"> \r\n             <div class=\"col-md-6\"><div class=\"card\"><div class=\"card-header bg-gray\"><h3 class=\"card-title titulonot_2\"><strong style=\"font-family: inherit; font-size: 1.53125rem;\">MISIÓN</strong><br></h3>\r\n                </div>\r\n                <!-- /.card-header -->\r\n                <div class=\"card-body titulonot_2\" style=\"padding: 25px\">\r\n\r\n                  <p>CONDUCIR Y PROMOVER EL DESARROLLO HUMANO INTEGRAL Y SOSTENIBLE DE LA POBLACION DEL DEPARTAMENTO DE HUÁNUCO, CON UNA GESTION MODERNA, TRANSPARENTE, COMPETITIVA E INCLUSIVA, BRINDANDO BIENES Y SERVICIOS DE CALIDAD, CON ÉNFASIS AMBIENTAL Y LA REDUCCION DE RIEGOS</p>\r\n                </div>\r\n                <!-- /.card-body -->\r\n              </div>\r\n            </div>\r\n\r\n            <div class=\"col-md-6\">\r\n              <div class=\"card\">\r\n                <div class=\"card-header bg-gray\">\r\n                  <h3 class=\"card-title titulonot_2\"><strong>VISIÓN</strong></h3>\r\n                </div>\r\n                <!-- /.card-header -->\r\n                <div class=\"card-body titulonot_2\" style=\"padding: 25px\">\r\n\r\n                  <p>HUÁNUCO TERRITORIO ANDINO AMAZÓNICO INTEGRADO, QUE HA IMPULSADO EL DESARROLLO HUMANO Y LA SOSTENIBILIDAD DE SU ECONOMIA, EN BASE A LA GRANDEZA DE SU BIODIVERSIDAD Y EL RESPETO POR LA INTERCULTURALIDAD</p>\r\n                </div>\r\n                <!-- /.card-body -->\r\n              </div>\r\n            </div>\r\n            \r\n          </div>',1,'2023-01-19 10:07:32','2023-01-21 08:41:47'),(16,'NUESTRA HISTORIA','<p>Huacaybamba ocupaba el séptimo lugar entre las parroquias de Huamalíes en 1741, con dos anexos: Rundubamba y Huarigancha. Ya en 1788, El caudillaje español del XXXIII Virrey Agustín de Jáuregu y Aldecoa, en una disputa de tierras confirma la existencia de los Centros Poblados de Huacaybamba, Rondobamba y Acobamba<br></p>',1,'2023-01-19 19:05:13','2023-01-19 19:05:13'),(17,'VALORES','<p>ESTON SON LOS VALORES</p>',1,'2023-01-19 19:30:11','2023-01-19 19:30:11'),(18,'DIRECTORIO',NULL,1,'2023-01-19 20:11:04','2023-01-19 20:11:04'),(19,'AREA DE DIRECCION','<p>.</p>',1,'2023-01-19 21:29:24','2023-01-19 21:29:24'),(20,'AREA DE GESTION PEDAGOGICA',NULL,1,'2023-01-19 21:29:46','2023-01-19 21:29:46'),(21,'AREA DE GESTION INSTITUCIONAL',NULL,1,'2023-01-19 21:30:22','2023-01-19 21:30:22'),(22,'AREA DE GESTION ADMINISTRATIVA',NULL,1,'2023-01-19 21:30:37','2023-01-19 21:30:37'),(23,'ASESORIA JURIDICA',NULL,1,'2023-01-19 21:30:52','2023-01-19 21:30:52'),(24,'RESOLUCION',NULL,1,'2023-01-19 21:38:34','2023-01-19 21:38:34'),(25,'DIRECTIVA',NULL,1,'2023